import axios from 'axios';

const BiomarkersUrl="http://localhost:8080/cancerMoonshot/getbiomarkers?id=1";

class Biomarker{

    getApiB(){
        return axios.get(BiomarkersUrl);
    }
}


export default new Biomarker();
